import React, { useState, useEffect } from 'react';
import OrdersAdminPage from './OrdersAdminPage';
import { useSelector } from 'react-redux';

function ParentComponent() {
    // Example state to store productsObj
    const [productsObj, setProductsObj] = useState(null);

    // Example useEffect to fetch productsObj from an API
    useEffect(() => {
        // Fetch productsObj from an API and set it in state
        // This is just an example, replace it with your actual fetch logic
        fetch('api/productsObj')
            .then(response => response.json())
            .then(data => setProductsObj(data));
    }, []);

    return (
        <div>
            {/* Render OrdersAdminPage component and pass productsObj as a prop */}
            <OrdersAdminPage productsObj={productsObj} />
        </div>
    );
}

export default ParentComponent;
